package main

import (
	"bytes"
	"fmt"
	"time"
)

func main() {

	fmt.Println("Starting...")

	t := time.Now()

	current := []byte(INPUT)

	for {
		b := bytes.NewBuffer(make([]byte, 0, len(current)))

		for i := 0; i < len(current); i++ {
			if i+1 < len(current) && current[i]^current[i+1] == 32 {
				i++
			} else {
				b.WriteByte(current[i])
			}
		}

		if len(current) == b.Len() {
			break
		}

		current = b.Bytes()
	}

	fmt.Println("Done:", len(current), time.Since(t))

	t = time.Now()
	var best []byte
	rawinput := []byte(INPUT)

	for c := byte('a'); c <= 'z'; c++ {

		current := rawinput

		for {
			b := bytes.NewBuffer(make([]byte, 0, len(current)))

			for i := 0; i < len(current); i++ {
				if current[i]|32 == c {
					continue
				} else if i+1 < len(current) && current[i]^current[i+1] == 32 {
					i++
				} else {
					b.WriteByte(current[i])
				}
			}

			if len(current) == b.Len() {
				break
			}

			current = b.Bytes()
		}

		if len(best) == 0 || len(current) < len(best) {
			best = current
		}
	}

	fmt.Println("Done 2:", len(best), time.Since(t))

}

func abs(a, b int) int {
	if a > b {
		return a - b
	}

	return b - a
}

